	public static function parse($url,$html)
	{
Log::info($url);
		$type = get_class();		
		$thiz = self::getInstance();
		$x = new XPath($html);	

			$ap = new Address_Parser();
			$op = new Operating_Hours_Parser();
			$pp = new Phone_Parser();
			$kvp = new KeyValue_Parser();
			$np = new Name_Parser();
		
		foreach ($x->query("//div[@id='MainCopy_ctl19_ContactsRepeaterPanel']//tr") as $node)
		{
			$x2 = new Xpath($node);
			$data = array();
			
			foreach ($x2->query("//a[contains(@id,'Contacts_DisplayName')]") as $node2)
			{
				$data['NAME'] = $node2->textContent;
				$data['PROFILE_URL'] = self::relative2absolute($url,$node2->getAttribute("href"));

			}
			if (empty($data['NAME'])) continue;

			foreach ($x2->query("//div[contains(@id,'Contacts_CompanyName')]") as $node2)
			{
				$data['COMPANY_NAME'] = self::cleanup($node2->textContent);
			}

			
			foreach ($x2->query("//div[contains(@id,'Contacts_Phone')]") as $node2)
			{
				$x3 = new Xpath($node2);
				$phone_type= '';
				foreach ($x3->query("//span[contains(@class,'searchResultsPhoneType')]") as $node3)
				{
					$phone_type = $node3->textContent;
				}
				if (!empty($phone_type))
				{
					foreach ($x3->query("//span[contains(@id,'Contacts_Phone')]") as $node3)
					{
						if ("searchResultsPhoneType" != $node3->getAttribute("class"))
							$data[$phone_type] = $node3->textContent;
					}
				}
			}
			foreach ($x2->query("//div[@class='addressDiv']") as $node2)
			{
				$data = array_merge($data,$ap->parse($node2->c14n()));
			}

			if (!empty($data['NAME']))
			{
				unset ($data["RAW_ADDRESS"]);
				$data['SOURCE_URL'] = $url;
				log::info($data);		
				db::store($type,$data,array('PROFILE_URL'));	
			}
		}
	}
